import { Center, Text, Wrap } from "@chakra-ui/react";

const Message = () => {
  return (
    <Center borderRadius='lg' backgroundColor='red.100' p='10px' justify="flex-end">
      <Text>
        This is a message!
      </Text>
      <Wrap />
    </Center>
  );
};

export default Message;
